import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
} from '@mui/material';
import {
  Science,
  LocalMall,
  MenuBook,
  HomeMaxOutlined,
  Toys,
  WbTwilight,
} from '@mui/icons-material';

const categories = [
  {
    name: 'Telescopes',
    description: 'Discover the cosmos with our premium telescopes',
    icon: <Science sx={{ fontSize: 40 }} />,
    filter: 'Telescopes & Accessories',
    image: 'https://images.unsplash.com/photo-1579532537598-459ecdaf39cc?auto=format&fit=crop&w=1024&q=80',
  },
  {
    name: 'Merchandise',
    description: 'Show your love for space with NASA apparel and collectibles',
    icon: <LocalMall sx={{ fontSize: 40 }} />,
    filter: 'Space Merchandise',
    image: 'https://images.unsplash.com/photo-1517976487492-5750f3195933?auto=format&fit=crop&w=1024&q=80',
  },
  {
    name: 'Study Materials',
    description: 'Learn about the universe with our educational resources',
    icon: <MenuBook sx={{ fontSize: 40 }} />,
    filter: 'Books & Education',
    image: 'https://images.unsplash.com/photo-1614935151651-0bea6508db6b?auto=format&fit=crop&w=1024&q=80',
  },
  {
    name: 'Home Decor',
    description: 'Transform your space with cosmic-themed decorations',
    icon: <HomeMaxOutlined sx={{ fontSize: 40 }} />,
    filter: 'Home & Lifestyle',
    image: 'https://images.unsplash.com/photo-1506318137071-a8e063b4bec0?auto=format&fit=crop&w=1024&q=80',
  },
  {
    name: 'Space Toys',
    description: 'Educational and fun space toys for all ages',
    icon: <Toys sx={{ fontSize: 40 }} />,
    filter: 'Gadgets & Kits',
    image: 'https://images.unsplash.com/photo-1446776811953-b23d57bd21aa?auto=format&fit=crop&w=1024&q=80',
  },
  {
    name: 'Galaxy Lamps',
    description: 'Bring the stars into your room with our galaxy projectors',
    icon: <WbTwilight sx={{ fontSize: 40 }} />,
    filter: 'Home & Lifestyle',
    image: 'https://images.unsplash.com/photo-1534293230397-c067fc201ab8?auto=format&fit=crop&w=1024&q=80',
  },
];

const Home = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (filter) => {
    navigate('/products', { state: { category: filter } });
  };

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          position: 'relative',
          height: '80vh',
          display: 'flex',
          alignItems: 'center',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundImage: 'url(https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2000&q=80)',
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            filter: 'brightness(0.4)',
          },
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 1 }}>
          <Typography
            variant="h1"
            sx={{
              color: 'white',
              fontWeight: 700,
              fontSize: { xs: '2.5rem', md: '4rem' },
              textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
              mb: 2,
            }}
          >
            Explore the Cosmos
          </Typography>
          <Typography
            variant="h5"
            sx={{
              color: 'rgba(255,255,255,0.9)',
              maxWidth: 600,
              mb: 4,
              textShadow: '1px 1px 2px rgba(0,0,0,0.5)',
            }}
          >
            Discover our collection of telescopes, space merchandise, and astronomical equipment
          </Typography>
          <Button
            variant="contained"
            size="large"
            onClick={() => navigate('/products')}
            sx={{
              bgcolor: '#7c4dff',
              fontSize: '1.2rem',
              py: 1.5,
              px: 4,
              '&:hover': {
                bgcolor: '#6c3fff',
                transform: 'translateY(-2px)',
              },
              transition: 'all 0.3s ease-in-out',
            }}
          >
            Shop Now
          </Button>
        </Container>
      </Box>

      {/* Categories Section */}
      <Container maxWidth="lg" sx={{ py: 8 }}>
        <Typography
          variant="h2"
          sx={{
            textAlign: 'center',
            mb: 6,
            color: 'white',
            fontSize: { xs: '2rem', md: '3rem' },
          }}
        >
          Featured Categories
        </Typography>
        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item key={category.name} xs={12} sm={6} md={4}>
              <Card
                onClick={() => handleCategoryClick(category.filter)}
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  background: 'rgba(255,255,255,0.05)',
                  backdropFilter: 'blur(10px)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                    border: '1px solid rgba(124,77,255,0.3)',
                    '& .MuiCardMedia-root': {
                      transform: 'scale(1.1)',
                    },
                  },
                }}
              >
                <Box sx={{ position: 'relative', overflow: 'hidden', pt: '60%' }}>
                  <CardMedia
                    component="img"
                    image={category.image}
                    alt={category.name}
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      width: '100%',
                      height: '100%',
                      transition: 'transform 0.3s ease-in-out',
                    }}
                  />
                  <Box
                    sx={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      right: 0,
                      bottom: 0,
                      background: 'linear-gradient(to bottom, rgba(0,0,0,0.4), rgba(0,0,0,0.1))',
                    }}
                  />
                </Box>
                <CardContent sx={{ flexGrow: 1, textAlign: 'center' }}>
                  <Box
                    sx={{
                      display: 'flex',
                      justifyContent: 'center',
                      mb: 2,
                      color: '#7c4dff',
                    }}
                  >
                    {category.icon}
                  </Box>
                  <Typography
                    variant="h5"
                    component="h2"
                    sx={{
                      color: 'white',
                      mb: 1,
                      fontWeight: 600,
                    }}
                  >
                    {category.name}
                  </Typography>
                  <Typography
                    sx={{
                      color: 'rgba(255,255,255,0.7)',
                    }}
                  >
                    {category.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
